import osimport pandas as pdimport numpy as npxl = pd.ExcelFile('Klippeark.xlsx')lectures = xl.parse(0).iloc[:,0].to_numpy()lectures = lectures[3:]for i in range(0,53):    lecture = ' '.join(lectures[i].split(' ')[1:]) + '.tsv'    df = xl.parse(i+1)    if len(df) == 0:        continue        df = df[['Start', 'Slut', 'Navn p√• klip', 'Rating']]    df.columns = ['t1','t2','name','rating']    df = df.dropna(axis=0,how='all')    df['rating'] = df['rating'].astype(int)        df.to_csv(lecture, sep='\t', index=False)#lectures = xl.sheet_names[1:]#test = [' '.join(x.split(' ')[1:]) for x in lectures]